import './App.css';
import {DropDownComponent, TestComponent, SingIn, Button, InputField} from './components';

function App() {
  return (
      <div className="App">
        <DropDownComponent/>
        <TestComponent/>
        <SingIn/>
        <Button/>
        <InputField/>
      </div>
  );
}

export default App;
